LEDイカリングバルブは、純正交換タイプのイカリング用バルブです。黄色い純正イカリングを、このLEDバルブに交換するだけで色温度7000ｋの白にすることが出来ます。 <br><br>特殊バルブな為、容易に交換できなかったヘッドライトリングバルブ。この部分が黄色く光ることにガッカリしていたユーザーに朗報です。　<br><br>■消費電力：6W　■入り数：2個　■カラー：7000ケルビン <br><br>対応車種：05-UP BMW E90 3シリーズ <br><br>車検対応品<br><br>ランプ、レンズ/バルブ<BR>※こちらの商品は代引き不可です<tr><td colspan="2">
